import "../styles/welcome.css"
import { plot } from "plotly.js";
import { Card, Container, Button, Col, Row } from "react-bootstrap";
import SimpleImageSlider from "react-simple-image-slider";
import home_img from "../statics/imgs/home_scrn.jpg"

const Welcome = () => {
    return (
        <Container >
            <div className="welc-div d-flex justify-items-center">
                <div className="p-2 ">
                    <Row>
                        <h1 className="text-secondary">Get a wider angle on coderhub.sa</h1>
                        <h5 className="text-secondary w-100">Explore coderhub.sa leaderboard data in a better way and gain more insights</h5>
                    </Row>
                </div>
                <div className="mt-2">        
                    <img className="shadow-lg" src={home_img} height={500} width={900}></img>
                </div>
            </div>
        </Container>
    );
}

export default Welcome;
